import lap5 from '../src/Images/lap-5.jpg';
import lap6 from '../src/Images/lap-6.jpg';
const Sdata = [
    {
        img:lap1,
        title: "Dell 01"
    },
    {
        img:lap2,
        title: "Dell 02"
    },
    {
        img:lap3,
